const baseUrl='https://api.rss2json.com/v1/api.json?rss_url=https://www.youtube.com/feeds/videos.xml?channel_id=UCkgY5iy0Y4SqQustDKlee7g';document.addEventListener("DOMContentLoaded",async function(){try{const b=await fetch(baseUrl).then(a=>a.json());if(!b.items)throw new Error;var a=0;for(a=0;a<10;a++)document.getElementById("myImg"+a).src=b.items[a].enclosure.thumbnail,document.getElementById("myAnchor"+a).href=b.items[a].enclosure.link,document.getElementById("tiTle"+a).innerHTML="   "+b.items[a].title}catch(a){console.log(a),console.log(`Couldn't retrieve videos, check your channel ID.`)}})